import React, { useState } from 'react';
import FluidSimulation from './FluidSimulation';
import './FluidDemo.css';

const FluidDemo = () => {
  const [config, setConfig] = useState({
    intensity: 0.5,
    speed: 1.0,
    color: '#4a90e2',
    interactive: true
  });

  const [size, setSize] = useState({
    width: 800,
    height: 600
  });

  const presetConfigs = [
    { name: 'Ocean Blue', color: '#006994', intensity: 0.6, speed: 0.8 },
    { name: 'Sunset', color: '#ff6b35', intensity: 0.7, speed: 1.2 },
    { name: 'Forest Green', color: '#2d5016', intensity: 0.4, speed: 0.6 },
    { name: 'Purple Haze', color: '#8a2be2', intensity: 0.8, speed: 1.5 },
    { name: 'Neon Pink', color: '#ff1493', intensity: 0.9, speed: 1.8 }
  ];

  const handlePresetChange = (preset) => {
    setConfig({
      ...config,
      color: preset.color,
      intensity: preset.intensity,
      speed: preset.speed
    });
  };

  const handleSizeChange = (newSize) => {
    setSize(newSize);
  };

  return (
    <div className="fluid-demo">
      <div className="demo-header">
        <h2>WebGL Fluid Simulation</h2>
        <p>Interactive 3D fluid particles with mouse control</p>
      </div>

      <div className="demo-content">
        <div className="simulation-container">
          <FluidSimulation
            width={size.width}
            height={size.height}
            intensity={config.intensity}
            speed={config.speed}
            color={config.color}
            interactive={config.interactive}
          />
        </div>

        <div className="controls-panel">
          <div className="control-section">
            <h3>Presets</h3>
            <div className="preset-buttons">
              {presetConfigs.map((preset, index) => (
                <button
                  key={index}
                  className="preset-btn"
                  style={{ backgroundColor: preset.color }}
                  onClick={() => handlePresetChange(preset)}
                >
                  {preset.name}
                </button>
              ))}
            </div>
          </div>

          <div className="control-section">
            <h3>Custom Settings</h3>
            <div className="slider-control">
              <label>Intensity: {config.intensity.toFixed(1)}</label>
              <input
                type="range"
                min="0.1"
                max="1.0"
                step="0.1"
                value={config.intensity}
                onChange={(e) => setConfig({...config, intensity: parseFloat(e.target.value)})}
              />
            </div>

            <div className="slider-control">
              <label>Speed: {config.speed.toFixed(1)}</label>
              <input
                type="range"
                min="0.1"
                max="2.0"
                step="0.1"
                value={config.speed}
                onChange={(e) => setConfig({...config, speed: parseFloat(e.target.value)})}
              />
            </div>

            <div className="color-control">
              <label>Color:</label>
              <input
                type="color"
                value={config.color}
                onChange={(e) => setConfig({...config, color: e.target.value})}
              />
            </div>

            <div className="checkbox-control">
              <label>
                <input
                  type="checkbox"
                  checked={config.interactive}
                  onChange={(e) => setConfig({...config, interactive: e.target.checked})}
                />
                Interactive Mode
              </label>
            </div>
          </div>

          <div className="control-section">
            <h3>Size</h3>
            <div className="size-buttons">
              <button
                className="size-btn"
                onClick={() => handleSizeChange({ width: 400, height: 300 })}
              >
                Small
              </button>
              <button
                className="size-btn"
                onClick={() => handleSizeChange({ width: 800, height: 600 })}
              >
                Medium
              </button>
              <button
                className="size-btn"
                onClick={() => handleSizeChange({ width: 1200, height: 800 })}
              >
                Large
              </button>
            </div>
          </div>

          <div className="control-section">
            <h3>Instructions</h3>
            <ul className="instructions">
              <li>Move your mouse over the simulation to interact</li>
              <li>Try different presets for various effects</li>
              <li>Adjust intensity and speed for custom behavior</li>
              <li>Change colors to match your theme</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FluidDemo;
